import React, { Component } from 'react';
import Topic from './componets/Topic';
import List from './componets/List';
import Recommd from './componets/Recommd';
import Writer from './componets/Writer';
import { 
    HomeWrapper,
    HomeLeft,
    HomeRight
} from './style';

class Home extends Component {
    render() {
        return (
            <HomeWrapper>
                <HomeLeft>
                    <img className='banner-img' src='//upload.jianshu.io/admin_banners/web_images/4686/b205842c3dd6736c233b052411fe1211f164fcaf.png?imageMogr2/auto-orient/strip|imageView2/1/w/1250/h/540' />
                    <Topic />
                    <List />
                </HomeLeft>
                <HomeRight>
                    <Recommd />
                    <Writer />
                </HomeRight>
            </HomeWrapper>
        )
    }
}

export default Home;
